function translateFromCamelCaseToHyphened(camelCaseIconName) {
  return camelCaseIconName.split(/(?=[A-Z])/).map((camelCasePart, index, allParts) => {
    if (index == allParts.length - 1) {
      return camelCasePart.toLowerCase();
    } else {
      return camelCasePart.toLowerCase() + '-';
    }
  }).join('');
}

Object.keys(SolidIcons).forEach((iconKey) => {
  //check camelCase
  if (iconKey != iconKey.toLowerCase()) {
    const hyphenedIconName = translateFromCamelCaseToHyphened(iconKey);
    //intercept equivalent hyphened icon key so we can translate
    Object.defineProperty(SolidIcons, hyphenedIconName, {
      get: () => {
        return SolidIcons[iconKey];
      }
    });
  }
});

Object.keys(RegularIcons).forEach((iconKey) => {
  //check camelCase
  if (iconKey != iconKey.toLowerCase()) {
    const hyphenedIconName = translateFromCamelCaseToHyphened(iconKey);
    //intercept equivalent hyphened icon key so we can translate
    Object.defineProperty(RegularIcons, hyphenedIconName, {
      get: () => {
        return RegularIcons[iconKey];
      }
    });
  }
});

Object.keys(BrandIcons).forEach((iconKey) => {
  //check camelCase
  if (iconKey != iconKey.toLowerCase()) {
    const hyphenedIconName = translateFromCamelCaseToHyphened(iconKey);
    //intercept equivalent hyphened icon key so we can translate
    Object.defineProperty(BrandIcons, hyphenedIconName, {
      get: () => {
        return BrandIcons[iconKey];
      }
    });
  }
});

function parseIconFromClassName(iconClassName) {
  if (!iconClassName) return;

  const Icons = iconClassName.indexOf('far') > -1 ? RegularIcons :
                iconClassName.indexOf('fab') > -1 ? BrandIcons :
                SolidIcons

  iconClassName = iconClassName.replace(/(fa\-)/gi, '')
  iconClassName = iconClassName.replace(/(fa|fas|far|fab)( )/gi, '')

  let nameParts = iconClassName.match(/(\-)(\w{1,1})/gi) || []

  nameParts.forEach(m => {
    iconClassName = iconClassName.replace(m, m.toUpperCase())
  })

  iconClassName = iconClassName.replace(/\-/gi, '') 
  iconClassName = (iconClassName || '').trim()

  return Icons[iconClassName]
}

export {
  SolidIcons,
  RegularIcons,
  BrandIcons,
  parseIconFromClassName
}